INSERT INTO `artikel` (`Id_Artikel`, `Judul_Artikel`, `Isi_Artikel`, `Tanggal`, `Tema`, `Gambar`, `Status`, `Penulis`) VALUES
	(3, 'Angka Vaksin di Indonesia Memecahkan Rekor', '<p>Rabu (30/06/2021) Muncul secercah berita menggembirakan di samping berita mengenai lonjakan kasus Covid 19 di Indonesia dalam beberapa pekan belakangan ini.</p>\r\n\r\n<p>Seperti yang dilansir dalam website Kemkes.go.id, perkembangan angka pemberian vaksin di Indonesia menunjukkan perkembangan yang signifikan. Pada hari Sabtu (26/06), Pemerintah telah berhasil mencapai target pemberian vaksin sebesar 1,31 juta vaksinasi per hari, lebih awal dari target awal yang ditetapkan oleh Presiden Joko Widodo yaitu mulai di bulan Juli.&nbsp;</p>\r\n\r\n<p>Tercapainya target awal vaksinasi yang lebih cepat dari perkiraan disebutkan karena upaya gotong royong yang maksimal dari berbagai pihak terutama TNI/Polri, Pemerintah Daerah, BUMN dan pihak swasta yang ikut membantu. Adapun hingga berita ini dirilis, proses pemberian vaksin bagi masyarakat umum di Indonesia masih terus berlangsung. &quot;Vaksinasi menjadi salah satu upaya penting dalam mengurangi laju penyebaran virus sehingga mengurangi lonjakan kasus dan membawa kita keluar dari pandemi. Salah satu strategi pemerintah adalah mengupayakan ketersediaan vaksin dan mempercepat program vaksinasi sehingga semakin banyak masyarakat terlindungi,&quot; urai Menteri Kesehatan Budi Gunadi.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kabar ini tentunya menggembirakan di antara banyaknya kabar yang beredar mengenai skeptisisme banyak pihak terhadap vaksin dan keengganan masyarakat untuk divaksin. Semoga angka pemberian vaksin di Indonesia yang mulai tinggi menjadi tanda baik dalam penanganan pandemi Covid-19 di Indonesia. *** (ayu)</p>\r\n', 'Saturday, 20-08-2022', 'Pemerintahan', '63005ba1f2c1a-1.jpg', 'Menunggu', 1),
	(4, 'Tempat Wisata di Kabupaten Malang Dibuka Kembali', '<p>REPUBLIKA.CO.ID, MALANG -- Pemerintah Kabupaten (Pemkab) akhirnya membuka tempat wisata kembali setelah ditutup akibat kebijakan PPKM Level 3 dan 4. Pembukaan ini menindaklanjuti penurunan level PPKM 2 yang dialami Kabupaten Malang.&nbsp;Pembukaan tempat wisata di Kabupaten Malang telah tertera dalam Surat Keputusan Dinas Pariwisata dan Kebudayaan (Disparbud) Kabupaten Malang nomor 556/810/35.07.108/2021 tentang pembukaan tempat wisata. Surat tersebut menyebutkan penurunan level Pemberlakuan Pembatasan Kegiatan Masyarakat (PPKM) ke level dua pada 2 November 2021 menjadikan sejumlah area publik dan tempat wisata dapat dibuka kembali. Namun pembukaan ini harus memenuhi syarat protokol kesehatan (prokes) Covid-19 dan pembatasan pengunjung maksimal 25 persen dari total kapasitas.</p>\r\n', 'Saturday, 20-08-2022', 'Pariwisata', '6301640b87915-1.jpg', 'Menunggu', 1);
/*!40000 ALTER TABLE `artikel` ENABLE KEYS */;

