/*!40000 ALTER TABLE `profil_kim` DISABLE KEYS */;
INSERT INTO `profil_kim` (`Id_Profil_KIM`, `Nama_Profil`, `Isi_Profil_KIM`, `Update_At`, `Penulis`) VALUES
	(1, 'Dasar Hukum KIM', '<p>1. Undang-Undang Nomor 25 Tahun 2004 tentang Desa (Lembaran Negara Tahun 2014 Nomor 7, Tambahan Lembaran Negara Nomor 5495);</p>\r\n\r\n<p>2. Undang-Undang Nomor 23 Tahun 2014 tentang Pemerintahan Daerah (Lembaran Negara Tahun 2014 Nomor 244, Tambahan Lembaran Negara Nomor 5587) sebagaimana telah diubah beberapa kali, terakhir dengan Undang-Undang Nomor 9 Tahun 2015 tentang Perubahan Kedua Atas Undang-Undang Nomor 23 Tahun 2014 tentang Pemerintahan Daerah (Lembaga Negara Tahun 2015 Nomor 58, Tambahan Lembaran Negara Nomor 56790;</p>\r\n\r\n<p>3. Peraturan Pemerintah Nomor 43 Tahun 2014 tentang Peraturan Pelaksanaan Undang-Undang Nomor 6 Tahun 2014 tentang Desa (Lembaran Negara Tahun 2014 Nomor 123, Tambahan Lembaran Negara Tahun2014 Nomor 5539), sebagaimana telah diubah dengan Peraturan Pemerintah Nomor 47 Tahun 2015 tentang Perubahan Atas Pelaksanaan Undang-Undang No 6 Tahun 2014 tentang Desa (Lembaran Negara Tahun 2015 Nomor 157, Tambahan Lembaran Negara Nomor 5717);</p>\r\n\r\n<p>4. Peraturan Menteri Komunikasi dan Informatika Nomor 08/PER/M.Kominfo/06/2010 tentang Pengembangan dan Pemberdayaan Lembaga Komunikasi Sosial;</p>\r\n\r\n<p>5. Peraturan Gubernur Jawa Timur Nomor 80 Tahun 2016 tentang Uraian Tugas Sekretariat, Bidang, Sub Bagian dan Seksi Dinas Komunikasi dan Informatika Provinsi Jawa Timur</p>\r\n', 'Friday, 19-08-2022', 1),
	(2, 'Pengertian KIM', '<p>Berdasarkan Peraturan Menteri Komunikasi dan Informatika RI No. 08/PER/M.KOMINFO/6/2010 tentang Pedoman Pengembangan dan Pemberdayaan Lembaga Komunikasi Sosial, tanggal 1 Juni 2010</p>\r\n\r\n<p>Kelompok Informasi Masyarakat atau KIM adalah kelompok yang dibentuk oleh masyarakat, dari masyarakat dan untuk masyarakat yang secara mandiri dan kreatif mengelola informasi dan pemberdayaan masyarakat guna meningkatkan nilai tambah. Definisi ini berdasarkan Peraturan Menteri Komunikasi dan Informatika Nomor 8 Tahun 2010. Singkatnya KIM adalah kelompok masyarakat yang aktif mengelola dan menyebarkan informasi kepada masyarakat secara swadaya.</p>\r\n', 'Friday, 19-08-2022', 1),
	(3, 'Tugas Pokok KIM', '<p>Tugas KIM Desa/Kelurahan adalah:</p>\r\n\r\n<p>1. Mewujudkan masyarakat yang aktif, peduli, peka dan memahami informasi.</p>\r\n\r\n<p>2. Memberdayakan masyarakat agar dapat memilah dan memilih informasi yang dibutuhkan dan bermanfaat.</p>\r\n\r\n<p>3. Mewujudkan jaringan informasi serta media komunikasi dua arah antara masyarakat maupun dengan pihak lainnya.</p>\r\n\r\n<p>4. Menghubungkan satu kelompok masyarakat dengan kelompok yang lainnya untuk mewujudkan kebersamaan, kesatuan dan persatuan bangsa.</p>\r\n', 'Friday, 19-08-2022', 1),
	(4, 'Fungsi KIM Pemerintahan/Desa', '<p>Selain menjalankan tugas tersebut, KIM Desa/Kelurahan juga memiliki fungsi sebagai berikut:</p>\r\n\r\n<p>1. KIM Desa/Kelurahan merupakan jembatan bagi anggota kelompok untuk saling bertukar informasi dengan sesama anggota KIM Desa/Kelurahan yang lain, pihak-pihak terkait, dan masyarakat Desa/Kelurahan pada umumnya. Selain itu, KIM Desa/Kelurahan juga dapat menjadi wahana informasi-komunikasi secara vertikal dengan pemerintah secara timbal balik.</p>\r\n\r\n<p>2. KIM Desa/Kelurahan berperan memberdayakan masyarakat agar memiliki kemampuan memecahkan masalah sendiri, sehingga mampu menjawab tantangan masa kini maupun masa depan.</p>\r\n\r\n<p>3. KIM Desa/Kelurahan berperan mendorong masyarakat di daerah pedesaan untuk menggerakkan aktivitas ekonomi produktif dengan memanfaatkan informasi sebagai nilai tambah untuk mencapai kesejahteraan dan meningkatkan taraf hidup.</p>\r\n\r\n<p>4. KIM Desa/Kelurahan berperan sebagai fasilitator bagi Masyarakat Desa/Kelurahan dan Mitra bagi Pemerintah Daerah.</p>\r\n', 'Friday, 19-08-2022', 1),
	(5, 'Peran KIM Pemerintahan/Desa', '<p>KIM berperan sebagai media forum, yaitu kelompok masyarakat yang memiliki aktivitas mengikuti informasi dari berbagai sumber, kemudian mendiskusikan hasil monitoring, dan menyalurkan informasi kepada masyarakat sekitarnya dan lebih lanjut mengimplentasikan dalam kehidupan sehari-hari. Dalam tahap berikutnya, setelah ada akses infrastruktur teknologi komunikasi dan informasi, maka KIM diarahkan untuk mendayagunakan teknologi komunikasi dan informasi tersebut.</p>\r\n\r\n<p>1. Sebagai mitra pemerintah dalam penyebarluasan, sosialisasi dan desiminasi informasi pembangunan kepada masyarakat.</p>\r\n\r\n<p>2. Sebagai mediator komunikasi dan informasi pemerintahan dan pembangunan secara timbal balik dan berkesinambungan.</p>\r\n\r\n<p>3. Sebagai forum media untuk pelayanan komunikasi dan informasi pemerintahan dan pembangunan.</p>\r\n', 'Friday, 19-08-2022', 1);
